 - "÷": [T: "division"]                             #  0xf7    (en: 'divided by')
 # SWEDISH: 1. We have decided to use character names based on the placement and appearance rather than the function of the characters, as the function might vary depending on context. 2. The modifier characters (Spacing Modifier Letters) occupy their own horizontal space within a line of text, but act as modifiers to the preceding character. We have decided to use the word "efter" (after) to distinguish them from the embellishment (combining) characters, which are rendered onto the preceding character. 3. We have decided to use the combining characters rendered above the preceding character as a baseline and omitted the placement word "över" (above). 
